<script>
    var date1 = new Date("1990-01-30");
    var date2 = new Date("1993-01-30");

    if (date1.getTime() > date2.getTime()) {
        console.log(date1);
    }
    else {
        console.log(date2);
    }

    date1.getTime() > date2.getTime() ? console.log(date1) : console.log(date2);
</script>
